import React from 'react';
import { Link as RouterLink } from 'react-router-dom';
import { Typography, Button } from '@mui/material';

function Navbar() {
  return (
    <div className="w-64 bg-[#88D8C0] text-white h-screen fixed top-0 left-0 flex flex-col p-6">
      <Typography variant="h5" className="font-bold text-white mb-10">
        POS System
      </Typography>
      <nav className="flex flex-col space-y-4">
        <Button
          component={RouterLink}
          to="/"
          className="bg-[#4CAF50] text-white hover:bg-[#4CAF50] rounded-full px-6 py-2 normal-case text-base font-normal"
        >
          Product
        </Button>
        <Button
          component={RouterLink}
          to="/orders"
          className="bg-[#4CAF50] text-white hover:bg-[#4CAF50] rounded-full px-6 py-2 normal-case text-base font-normal"
        >
          Order
        </Button>
        <Button
          component={RouterLink}
          to="/new-order"
          className="bg-[#B3E5D6] text-white hover:bg-[#B3E5D6] rounded-full px-6 py-2 normal-case text-base font-normal"
        >
          + New Order
        </Button>
      </nav>
    </div>
  );
}

export default Navbar;
